{'videoId': '807bl3tWsbw', 'topLevelComment': {'kind': 'youtube#comment', 'etag': 'JSk-LQtdKlfMXTYvHrzqGqQCvbk', 'id': 'UgyAFK5yoy7usDbICTp4AaABAg', 'snippet': {'videoId': '807bl3tWsbw', 'textDisplay': 'Quando a Lava Jato começou e atingiu seu auge, eu estava morando no interior da Bahia. Distante dos grandes debates, dando aulas de Língua Portuguesa ao longo do dia, refém de grupos que dominavam as ideias a favor da &quot;moralização na política&quot; encabeçada por Sérgio Moro, eu também me perdi com as narrativas impostas aos brasileiros. Dentro de mim, algo permanecia incomodando até que me afastei do que via, ouvia e lia e me dei conta da imensa farsa com fim único de tirar Lula da corrida presidencial. O estalo veio exatamente ao assistir a uma audiência do Lula em que, olhar firme, voz tranquila, deixou claro que o juiz mentia. E foi um despertar libertador que me permitiu estar em consonância com o que sempre fui: alma combativa de esquerda. <br><br>Haveremos de vencer!<br><br>♥️ 13', 'textOriginal': 'Quando a Lava Jato começou e atingiu seu auge, eu estava morando no interior da Bahia. Distante dos grandes debates, dando aulas de Língua Portuguesa ao longo do dia, refém de grupos que dominavam as ideias a favor da "moralização na política" encabeçada por Sérgio Moro, eu também me perdi com as narrativas impostas aos brasileiros. Dentro de mim, algo permanecia incomodando até que me afastei do que via, ouvia e lia e me dei conta da imensa farsa com fim único de tirar Lula da corrida presidencial. O estalo veio exatamente ao assistir a uma audiência do Lula em que, olhar firme, voz tranquila, deixou claro que o juiz mentia. E foi um despertar libertador que me permitiu estar em consonância com o que sempre fui: alma combativa de esquerda. 

Haveremos de vencer!

♥️ 13', 'authorDisplayName': 'Marilene Martins', 'authorProfileImageUrl': 'https://yt3.ggpht.com/ytc/AGIKgqPrRb7CXfLkCny1y2htqMwmQIXzVRUELG1IDv3s_yQ=s48-c-k-c0x00ffffff-no-rj', 'authorChannelUrl': 'http://www.youtube.com/channel/UCyHZe_2qx7V_1dpMMA7wFWg', 'authorChannelId': {'value': 'UCyHZe_2qx7V_1dpMMA7wFWg'}, 'canRate': True, 'viewerRating': 'none', 'likeCount': 35, 'publishedAt': '2022-10-09T11:24:37Z', 'updatedAt': '2022-10-09T11:24:37Z'}}, 'canReply': True, 'totalReplyCount': 4, 'isPublic': True}

